$(function(){
	//Nav
	$(window).scroll(function(){
		var scrolltop = $(this).scrollTop();
		if (scrolltop >= 70){
			$("#nav").addClass("navfixed");//css({"position":"fixed","top":"0"});
		}else {
			$("#nav").removeClass("navfixed");//css({"position":"static"});
		}
	});
	//Search
	$(".submit").click(function(){
		var searchbox = $(".searchbox").val();
		var placeholder = $(".searchbox").attr("placeholder");
		if (searchbox == placeholder || searchbox == ""){
			$(".search-error").show();
			return false
		}
	});
	$(".searchbox").focus(function(){
		$(".search-error").hide();
	});
	// Search
	$("#show").toggle(function(){
		$(".search").slideDown();
		$(this).text($(this).attr("two"));
	},function(){
		$(".search").slideUp();
		$(".search-error").hide();
		$(this).text($(this).attr("one"));
	});
	
	//slimbox
	if($('#content a:has(img)').length > 0){
		$('#content a:has(img)').slimbox();
	};

timeAgo("timeago");
setInterval("timeAgo('timeago')",60000);

});

document.getElementsByTagName("body")[0].onmouseup = function(){     
    var selected = getSelectedText(); 
    if(selected.length > 0)alert(selected);   
} 
function getSelectedText(){
    if(window.getSelection){
        return window.getSelection().toString();
    }else if(document.selection){
        return document.selection.createRange().text;
    }
}


